    false,nt"url": null,nt"notes": "The HCL20082012 dataset contains High Crash
    Locations (HCLs) for intersections and sections for data years 2008-2012. The HCLs
    in this dataset are based on the number of crashes and not the severity of the crashes.
    The intersections and sections analyzed in this dataset are limited to those highways
    that fall under the Federal Aid Highway system. A good overview of of the 2006-2010
    HCL data is available in this http://highwaysafety.vermont.gov/sites/vhsa/files/documents/data/2008-2010%20Formal%20High%20Crash%20Location%20Report.pdf",nt"license_title":
